import React from 'react';
import {
    Bonuses,
    Buttons,
    Card,
    ColorText,
    Content, Footer,
    HeaderCard,
    Img, OriginalPrice, Price, Prices,
    Rating,
    Stars,
    Title
} from "../Product/productStyle";
import {Cart, Comparison, Favorite, New, Recommended, Sale, Star} from "../../assets/icons";
import {IconButton} from "../IconButton/IconButton";
import productImg from "../../assets/images/static/product.png";
import {Button} from "../Button/Button";

const HistoryCard = () => {
    return (
        <Card>
            <Img>
                <img src={productImg}/>
            </Img>
            <Content>
                <ColorText green>В наличии</ColorText>
                <Title>Беговая дорожка CardioPower S35</Title>
                <Rating>
                    Ретинг
                    <Stars>
                        <Star/>
                        <Star/>
                        <Star/>
                        <Star/>
                        <Star/>
                    </Stars>
                </Rating>

                <Footer>
                    <Prices>
                        <Price current>1 134 900 ₽</Price>
                        <OriginalPrice>1 134 900 ₽</OriginalPrice>
                    </Prices>
                    <Button>
                        <Cart/> Купить
                    </Button>
                </Footer>
            </Content>
        </Card>
    );
};

export default HistoryCard;
